import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
function Home() {
    return (
        <div className='row'>
            <div className='col-1 bs-secondary-bg'>
                right
            </div>
            <div className='col-11'>
                left
            </div>
        </div>
    );
}

export default Home;
